import React from "react";
import './QuestionPage.styles.css'
import questions from '../../gameConfig.json'


export const QuestionPage: React.FC=() => {
	console.log(questions)
	return (
		<div className={"QuestionPage-container"}>
			<div className={"Question-block"}>
				<h1>{questions.questions[ 0 ].question}</h1>
				<div className={"Options-container"}>
					{questions.questions[ 0 ].options.map((option: { label: string; value: string }, index: number) => (
						<div><span>{option.label}</span><span>{option.value}</span></div>))}
				</div>
			</div>
			<div className={"Reward-block"}></div>
		</div>
	)
}
